// src/components/Register.jsx
import React, { useState } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

const Register = () => {
    // Estados para cada campo del formulario
    const [pnombre, setPnombre] = useState('');
    const [edad, setEdad] = useState('');
    const [ubicacion, setUbicacion] = useState('');
    const [identificacion, setIdentificacion] = useState('');
    const [sNombre, setSNombre] = useState('');
    const [pApellido, setPApellido] = useState('');
    const [sApellido, setSApellido] = useState('');
    const [email, setEmail] = useState('');
    const [fechaNacimiento, setFechaNacimiento] = useState('');
    const [login, setLogin] = useState('');
    const [password, setPassword] = useState('');

    const handleRegister = async (e) => {
        e.preventDefault(); // Previene la recarga de la página

        // Crear el objeto persona
        const persona = {
            pnombre,
            edad: parseInt(edad),
            ubicacion,
            identificacion: parseInt(identificacion),
            SNombre: sNombre,
            PApellido: pApellido,
            SApellido: sApellido,
            email,
            fechaNacimiento: new Date(fechaNacimiento) // Convertir a fecha
        };

        // Crear el objeto usuario
        const usuario = {
            login,
            password
        };

        try {
            // Enviar los datos al backend
            const response = await axios.post('/api/register', { persona, usuario });
            console.log('Registro exitoso:', response.data);
            // Puedes redirigir o mostrar un mensaje de éxito aquí
        } catch (error) {
            console.error('Error al registrar:', error);
            // Manejo de errores aquí
        }
    };

    return (
        <div className="container">
            <h1>Registro</h1>
            <form onSubmit={handleRegister}>
                {/* Campos del formulario */}
                <div className="mb-3">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Primer Nombre"
                        value={pnombre}
                        onChange={(e) => setPnombre(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <input
                        type="number"
                        className="form-control"
                        placeholder="Edad"
                        value={edad}
                        onChange={(e) => setEdad(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Ubicación"
                        value={ubicacion}
                        onChange={(e) => setUbicacion(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <input
                        type="number"
                        className="form-control"
                        placeholder="Identificación"
                        value={identificacion}
                        onChange={(e) => setIdentificacion(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Segundo Nombre"
                        value={sNombre}
                        onChange={(e) => setSNombre(e.target.value)}
                    />
                </div>
                <div className="mb-3">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Primer Apellido"
                        value={pApellido}
                        onChange={(e) => setPApellido(e.target.value)}
                    />
                </div>
                <div className="mb-3">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Segundo Apellido"
                        value={sApellido}
                        onChange={(e) => setSApellido(e.target.value)}
                    />
                </div>
                <div className="mb-3">
                    <input
                        type="email"
                        className="form-control"
                        placeholder="Email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <input
                        type="date"
                        className="form-control"
                        value={fechaNacimiento}
                        onChange={(e) => setFechaNacimiento(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <input
                        type="text"
                        className="form-control"
                        placeholder="Login"
                        value={login}
                        onChange={(e) => setLogin(e.target.value)}
                        required
                    />
                </div>
                <div className="mb-3">
                    <input
                        type="password"
                        className="form-control"
                        placeholder="Contraseña"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        required
                    />
                </div>
                <button type="submit" className="btn btn-primary">Registrar</button>
            </form>
        </div>
    );
};

export default Register;
